import React from 'react';
import './StyledCard.css';


const StyledCard = () =>{
    return(
        <div className="container">
            <div className="bgBox">
            </div>
            <h1 className="highlight">Who am I?</h1>
            <div className="rightContainer">

            </div>
        </div>
    )
}

export default StyledCard;
